import React from "react";

function Cart() {
  return (
    <div style={{ backgroundColor: "white", padding: "2rem" }}>
      <h1>Cart Page</h1>
      <p>Your cart items will appear here.</p>
      <button style={{ backgroundColor: "red", color: "white" }}>Checkout</button>
    </div>
  );
}

export default Cart;
